uniform float iTime;
uniform vec2 iResolution;
uniform vec4 iMouse;
uniform sampler2D iChannel0;

// User Parameters
uniform float u_speed;
uniform float u_complexity;
uniform float u_transparency;
uniform float u_glow_intensity;
uniform float u_orb_size;
uniform float u_hole_size;

out vec4 fragColor;

// --- Math Utilities ---
mat2 rot(float a) {
    float s = sin(a), c = cos(a);
    return mat2(c, -s, s, c);
}

float sdSphere(vec3 p, float s) {
    return length(p) - s;
}

// Gyroid formula: sin(x)cos(y) + sin(y)cos(z) + sin(z)cos(x)
float gyroid(vec3 p, float scale, float thickness, float bias) {
    p *= scale;
    return abs(dot(sin(p), cos(p.yzx)) - bias) / scale - thickness;
}

// Global variables to track which object we hit
float g_isOrb = 0.0;

// Fractal Tech logic combining gyroids at multiple scales
float map(vec3 p) {
    // 1. Outer Fractal Shell Logic
    vec3 pShell = p;
    pShell.xz *= rot(iTime * 0.1 * u_speed);
    pShell.xy *= rot(iTime * 0.07 * u_speed);

    float globe = sdSphere(pShell, 3.5);
    float innerHole = sdSphere(pShell, u_hole_size); // Create the hole

    float g1 = gyroid(pShell, 1.5, 0.05, 0.5);
    float g2 = gyroid(pShell + 1.2, 3.2, 0.03, 0.3);
    float g3 = gyroid(pShell * 2.1, 6.4, 0.01, 0.1);

    float tech = max(g1, -g2); 
    tech = min(tech, g2);      
    tech = mix(tech, g3, 0.3); 

    float shell = max(globe, tech * u_complexity);
    shell = max(shell, -innerHole); // Carve the hole

    // 2. Inner Orb Logic
    vec3 pOrb = p;
    // Spin in opposite direction
    pOrb.xz *= rot(-iTime * 0.4 * u_speed);
    pOrb.yz *= rot(-iTime * 0.25 * u_speed);

    float orb = sdSphere(pOrb, u_orb_size);
    // Add some "plasma" texture to the orb surface
    float orbDetail = gyroid(pOrb, 10.0, 0.02, 0.1);
    orb = max(orb, orbDetail * 0.5);

    // Combine
    float res = min(shell, orb);

    // Tag the orb for shading logic
    if (res == orb) g_isOrb = 1.0;
    else g_isOrb = 0.0;

    return res;
}

// Normal calculation for lighting
vec3 getNormal(vec3 p) {
    vec2 e = vec2(0.01, 0.0);
    return normalize(vec3(
        map(p + e.xyy) - map(p - e.xyy),
        map(p + e.yxy) - map(p - e.yxy),
        map(p + e.yyx) - map(p - e.yyx)
    ));
}

void main() {
    vec2 uv = (gl_FragCoord.xy - 0.5 * iResolution.xy) / iResolution.y;

    // Camera Setup
    vec3 ro = vec3(0.0, 0.0, -8.0);
    vec3 ta = vec3(0.0, 0.0, 0.0);

    float mx = iMouse.z > 0.0 ? (iMouse.x / iResolution.x - 0.5) * 6.28 : 0.0;
    float my = iMouse.z > 0.0 ? (iMouse.y / iResolution.y - 0.5) * 3.14 : 0.0;
    ro.yz *= rot(my);
    ro.xz *= rot(mx);

    vec3 f = normalize(ta - ro);
    vec3 r = normalize(cross(vec3(0, 1, 0), f));
    vec3 u = cross(f, r);
    vec3 rd = normalize(f + uv.x * r + uv.y * u);

    // Raymarching
    float t = 0.0;
    float glow = 0.0;
    float dist = 0.0;
    vec3 p;
    float hitOrb = 0.0;

    for(int i = 0; i < 100; i++) {
        p = ro + rd * t;
        dist = map(p);

        // Accumulate glow (stronger near the center for the orb)
        float glowDist = dist;
        glow += exp(-glowDist * 3.5) * u_glow_intensity;

        // Extra inner core glow
        glow += exp(-length(p) * 1.5) * 0.1 * u_glow_intensity;

        if(dist < 0.001 || t > 25.0) {
            hitOrb = g_isOrb;
            break;
        }
        t += dist * 0.5; 
    }

    vec3 col = vec3(0.0);

    if(t < 25.0) {
        vec3 n = getNormal(p);
        vec3 l = normalize(vec3(1.0, 1.0, -1.0));

        float rim = pow(1.0 - max(dot(n, -rd), 0.0), 3.0);
        float diff = max(dot(n, l), 0.0);

        vec3 baseColor;
        if(hitOrb > 0.5) {
            // Hot core color
            baseColor = mix(vec3(1.0, 0.3, 0.1), vec3(1.0, 0.8, 0.2), sin(iTime * 2.0) * 0.5 + 0.5);
            col = baseColor * (diff + rim * 3.0);
        } else {
            // Tech shell color
            baseColor = mix(vec3(0.1, 0.4, 0.8), vec3(0.0, 1.0, 0.9), sin(p.z * 0.5 + iTime) * 0.5 + 0.5);
            col = baseColor * diff;
            col += vec3(0.5, 0.8, 1.0) * rim * 2.0;

            vec3 tex = texture(iChannel0, p.xy * 0.1 + p.z * 0.1).rgb;
            col += tex * 0.1;
        }

        float alpha = clamp(u_transparency + rim, 0.0, 1.0);
        col *= alpha;
    }

    // Procedural background
    float bg = pow(clamp(dot(rd, vec3(0.0, 0.0, 1.0)), 0.0, 1.0), 10.0) * 0.2;
    col += vec3(0.05, 0.1, 0.2) * bg;

    // Apply accumulated glows
    vec3 shellGlow = vec3(0.1, 0.5, 1.0) * glow * 0.02;
    vec3 coreGlow = vec3(1.0, 0.4, 0.1) * exp(-length(uv) * 2.0) * 0.3; // Center screen glow

    col += shellGlow;
    col += coreGlow * u_glow_intensity * 0.2;

    // Post Processing
    col = pow(col, vec3(0.4545)); 
    col *= 1.2 - length(uv) * 0.5;

    fragColor = vec4(col, 1.0);
}
